import React, { useState } from 'react';
import homeImage from "../../Media/introLeft.png";
import Button from "@material-ui/core/Button";
import { makeStyles } from '@material-ui/core/styles';
import FavoriteIcon from '@material-ui/icons/Favorite';
import ImageIcon from '@material-ui/icons/Image';
import imageMenu from "../../Media/imageMenu.png";
import aboutImage from "../../Media/aboutImage.png";
import MissionModal from "./missionModal";
import GalleryModal from "./galleryModal";
import WhoModal from "./whoWeAreModal";
import { ButtonBase } from "@material-ui/core";

const useStyles = makeStyles((theme) => ({
  
  }));


const MenuPropDisplay = (props) =>{
    const classes = useStyles();

    const [open, setOpen] = React.useState(false);

    
  const handleClickOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };




    let value = props.MenuArray;

    let [openProp, setProp] = useState(false);

  

    if(value === 0) return (
        <div>
          <Button onClick={()=> setProp(openProp = true)}>
            
        <img src={imageMenu}/>
        
        </Button>
         <Button
        variant="contained"
        color="secondary"

        onClick={handleClickOpen}
        style={{
          marginTop: '-20%'
        }}
      >
        View our work
      </Button>
      
      </div>
    )
      




    else if (value === 2 ){
        return (
            <div>
              <Button>
            <img src={aboutImage}/>
            </Button>
           <WhoModal/>
          </div>
        )
    }




    else return (
        <div>
          <Button>
        <img src={homeImage}/>
        </Button>
      <MissionModal/>
      </div>
    )
}

export default MenuPropDisplay;
